import React from 'react';
import { Container, Row, Col, Button } from 'react-bootstrap';
import { ArrowRight } from 'react-bootstrap-icons';
import './index.scss';

function Home() {
  return (
    <React.Fragment>
      <Container fluid>
        <Row>
          <Col className="header">
            <Container>
              <div className="header-info">
                <h1>Juniors make IT work</h1>
                <strong>Hire and invest in highly skilled juniors now.</strong>
                <Button variant="primary">Post Offer Now</Button>
              </div>
            </Container>
          </Col>
        </Row>
      </Container>
      <Container className="job-offers">
        <Row>
          <Col>
            <h2>Newest Job Offers</h2>
            <a href="#">View all job offers <ArrowRight color="royalblue" size={16} /> </a>
          </Col>
        </Row>
      </Container>
    </React.Fragment>
  );
}

export default Home;
